#!/usr/bin/env python3
"""Insight Bot - creates all project files. Run: python3 create_project.py"""
import os, base64, json

DATA = ""

files = json.loads(base64.b64decode(DATA))
for path, content in files.items():
    full = os.path.join(os.path.dirname(os.path.abspath(__file__)), path)
    os.makedirs(os.path.dirname(full) if os.path.dirname(full) else ".", exist_ok=True)
    with open(full, "w") as f:
        f.write(content)
    print(f"  Created: {path}")

print()
print("===== Project updated! =====")
print(f"Total files: {len(files)}")
print()
print("Next steps:")
print("  docker compose up -d --build")
print("  docker compose logs -f bot")
